def DCT_Basis(repeats=None):
    N = 8
    basis = []
    for u in range(8):
        for v in range(8):
            z = np.zeros((N,N))
            for i in range(N):
                for j in range(N):
                    z[i,j] = np.cos(np.pi*(2*i+1)*u / (2*N)) * np.cos(np.pi*(2*j+1)*v / (2*N))
            basis.append(z)

    if repeats is None:
        return basis

    return torch.Tensor([basis,basis,basis]).permute((1,0,2,3))
